            displaySeqNum: 3,
            featureText: '<ul style="list-style: none;"><br/>\n  <li><strong>Verizon 5G</strong><sup>1</sup></li></ul>\n\n  <ul style="list-style: none;"><br/>\n    <li><strong>Home Internet</strong><sup>2</sup></li>\n    <li>Starting at &#36;40/mo</li></ul>\n    \n<ul style="list-style: none;"><br/>\n<li><strong>All plans include</strong></li>\n  \n<li>Unlimited talk, text & data</li>\n<li>Mexico & Canada talk, text & data<sup>3</sup></li>\n<li>5G and 4G LTE</li>\n<li>International texting<sup>4</sup></li></ul></ul>\n\n<ul style="list-style: none;"><br/>\n<li><strong>Perks</strong></li>\n<li>Disney Bundle</li>\n<li>100 GB Mobile Hotspot</li>\n<li>Walmart+ Membership</li>\n<li>Apple One (includes an upgrade option to Apple One Family for additional &#36;10 / month)</li>\n<li>2 TB Cloud</li>\n<li>Wearable Bundle</li>\n<li>\'+Play Credit</li>\n<li>3 TravelPass Days</li>\n<li>Apple Music Family</li>\n</ul>\n\n<ul><small>\n1. Requires a 5G&#45;capable device inside the Verizon 5G coverage area.</br>\n2. Get up to 20&#37; off your Verizon 5G Home or LTE Home Internet plan, or get Fios internet and save with the Mobile + Home Discount. Both as low as &#36;40/mo when enrolled in Auto Pay, where service is available.</br>\n3. After 2GB/day get unlimited 3G data speeds. Also includes Unlimited talk and text to Mexico and Canada when you are in the US.</br>\n4. From the US to over 220 countries and territories worldwide.\n</small></ul>',
