          data: {
            displayName: '100 GB Mobile Hotspot',
            backgroundImage: 'perk-tile-mobile-hotspot',
            faqList: [
              {
                description: '<p> A Mobile Hotspot lets you share your Verizon network connection with other devices so they can access the internet. Devices connect to your Mobile Hotspot using Wi-Fi. While devices are connected, you’re charged for any data they use according to your monthly data plan. </p>',
                title: 'What is Mobile Hotspot?',
                merchantName: 'Verizon MHS',
                faqName: '100 GB Mobile Hotspot Perk #1'
              },
              {
                description: '<p> All of our currently available smartphones and basic phones are compatible with Mobile Hotspot features or apps. If you have an older device, refer to the User Guide on your Device Support page to be sure Mobile Hotspot is compatible. </p>',
                title: 'Which Verizon mobile devices are compatible with Mobile Hotspot?',
                merchantName: 'Verizon MHS',
                faqName: '100 GB Mobile Hotspot Perk #2'
              },
              {
                description: '<p> No. Mobile Hotspot comes preinstalled on compatible devices. Depending on your device, it may be in your device’s App menu or Settings. It may also be named something different, like Personal Hotspot (iOS), Internet Sharing (Windows) or Portable Wi-Fi Hotspot (Google Nexus devices). </p>',
                title: 'Do I need to download a Mobile Hotspot app to my device to use 100 GB Mobile Hotspot?',
                merchantName: 'Verizon MHS',
                faqName: '100 GB Mobile Hotspot Perk #3'
              },
              {
                description: '<p> Mobile Hotspot data is included in many Verizon mobile plans. 100 GB Mobile Hotspot will stack on top of any existing Mobile Hotspot data included with your Verizon mobile plan. </p>',
                title: 'What if I already have Mobile Hotspot data on my line and enroll in 100 GB Mobile Hotspot?',
                merchantName: 'Verizon MHS',
                faqName: '100 GB Mobile Hotspot Perk #4'
              },
              {
                description: '<p> You have full access to 100 GB of Mobile Hotspot data for the full length of your current billing cycle. </p>',
                title: 'How long do I have to use 100 GB Mobile Hotspot?',
                merchantName: 'Verizon MHS',
                faqName: '100 GB Mobile Hotspot Perk #5'
              },
              {
                description: '<p> You can contact <a href="/support/contact-us/" style="color:inherit">Verizon customer support</a> for questions about perk eligibility, charges for 100 GB Mobile Hotspot on your Verizon bill, or redeeming the perk. </p> <br /> <p><a href="/support/hotspot-perk-faqs/" style="color:inherit">All FAQs</a>',
                title: 'Who can I contact if I have questions about 100 GB Mobile Hotspot?',
                merchantName: 'Verizon MHS',
                faqName: '100 GB Mobile Hotspot Perk #6'
              }
            ],
            id: '2621',
            titles: [
              {
                titleName: 'What’s included_2621',
                displayName: 'What’s included',
                description: 'With this perk, you get 100 GB of mobile hotspot data. Mobile hotspots allow you to create a secure, reliable Wi-Fi connection. You can then use your personal, private hotspot connection on any Wi-Fi enabled device, such as a laptop, tablet or smartphone. You can create a mobile hotspot on most smartphones, and by using a dedicated device and mobile hotspot data plan, you can allow more devices to be connected to your secure, private network at one time. Using data specifically allotted to your mobile hotspot device won’t then detract from your smartphone’s data plan.'
              },
              {
                titleName: '100 GB Mobile Hotspot',
                displayName: 'Important information',
                description: '<ul class="important-information">\n<li>All of Verizon’s currently available smartphones and basic phones are compatible with Mobile Hotspot.</li>\n<li>Allows your smartphone to become a 5G / 4G Wi-Fi connection for devices like tablets, laptops and more.</li>\n<li>100 GB Mobile Hotspot will stack on top of any existing Mobile Hotspot data included with your Verizon mobile plan.</li>\n<li>100 GB Mobile Hotspot data can only be used within your current billing cycle. Unused data does not carry over to the next billing cycle.</li>\n<li>Unlimited Ultimate, Unlimited Plus, Unlimited Welcome &amp; Welcome Unlimited are eligible to purchase the 100 GB Mobile Hotspot plan perk.</li>\n<li>Billing begins upon enrollment.</li></ul>'
              }
            ],
            type: 'SPO',
            termsAndConditions: '<p> If you are (1) a legal resident of the 50 United States and D.C. and (2) 18 years of age or older, on an Unlimited Welcome or Unlimited Plus phone plan, you are eligible to purchase the $10/mo &ldquo;100 GB Mobile Hotspot&rdquo; plan perk. </p>\n<p> One offer per line per billing cycle. </p>\n<p> Billing begins upon enrollment. Enrollment and access begins upon activation of the line. </p>\n<p> 100 GB Mobile Hotspot is stackable with existing plan allowances. </p>\n<p> Welcome 1.0 lines are not eligible to enroll in 100 GB Mobile Hotspot. </p>\n<p> Upon full usage of 100 GB Mobile Hotspot, mobile hotspot speeds will be reduced to up to 3 Mbps when on 5G Ultra Wideband and 600 Kbps when on 5G Nationwide / 4G LTE for the remainder of your monthly billing cycle. </p>\n<p> You can cancel 100 GB Mobile Hotspot at any time from My Verizon Online or My Verizon App. After cancellation, you will still have access to the remainder of your current 100 GB allotment for the remainder of your then current billing cycle. You will no longer receive additional allotments thereafter. Offer may end without notice. </p>\n<p> Use of 100 GB Mobile Hotspot is subject to <a style="color:inherit" tabindex="0" data-track="important plan information" href="/support/important-plan-information/">Important Plan Information</a>. </p>'
          },
