                description: '<p> TravelPass lets you use your domestic talk, text and data* in 210+ countries and destinations outside the US. You can call within the country you’re visiting and you can call back to the US. </p> <br /> <p style="font-size:12px">* High speed data applies for the first 2 GB/day with 3G reduced speeds thereafter. If more than 50% of your talk, text or data usage in a 60-day period is in Canada or Mexico, use of those services in those countries may be removed or limited.</p>',
