                description: '<ul class="important-information">\n<li>Unlimited talk, text and data in 210+ countries and destinations.</li> <li>After the first 2 GB high speed data, you get unlimited 3G data to use for the remainder of the TravelPass session.</li> <li>Accrue up to 36 TravelPass Days with this perk.</li> <li>TravelPass Days expire 12 months after receiving them with this perk.</li> <li>Unlimited Plus, Unlimited Welcome & Welcome Unlimited are eligible to purchase the 3 TravelPass Days plan perk.</li>\n <li>Can only be used on the line enrolled in 3 TravelPass Days. Non-transferable.</li></ul>'
