                description: '<ul class="important-information">\n<li>Care Smart Get Help - Professional Monitoring available from Verizon for Apple Watch Series 4 or later, Samsung Galaxy Watch4 or later, and Google Pixel Watch.</li> \n<li>Smartwatch Data &amp; Safety provides a full discount on a smartwatch data plan and a full discount on a subscription to Get Help - Professional Monitoring.</li> \n<li>If canceling Smartwatch Data &amp; Safety you will lose your discount. Without the discount, you will be charged $10 for your smartwatch data plan.</li>\n<li>Unlimited Ultimate, Unlimited Plus, Unlimited Welcome &amp; Welcome Unlimited are eligible to purchase the Smartwatch Data &amp; Safety plan perk.</li> \n<li>Care Smart Get Help - Professional Monitoring will be canceled along with cancellation of Smartwatch Data &amp; Safety. Your smartwatch data plan must be canceled separately.</li></ul>'
