            type: 'SPO',
            termsAndConditions: '<p> If you are (1) a legal resident of the 50 United States and D.C. and (2) 18 years of age or older, on a Welcome Unlimited, Unlimited Welcome or Unlimited Plus phone plan, you are eligible to purchase the $10/mo &ldquo;Smartwatch Data &amp; Safety&rdquo; plan perk. </p>\n<p> One offer per line. </p>\n<p> Billing begins upon enrollment. Enrollment and access begins upon activation of the line. </p>\n<p> Smartwatch Data &amp; Safety includes full discount access to a smartwatch data plan and full discount to a subscription to Care Smart with Get Help - Professional Monitoring. Smartwatch not included. </p>\n<p> Get Help - Professional Monitoring is only compatible with Apple Watch Series 4 or later, Samsung Galaxy Watch4 or later, and Google Pixel Watch. </p>\n<p> Your Apple Watch, Galaxy Watch, or Google Pixel Watch must be connected and enrolled in Get Help - Professional Monitoring in order to receive the discount. </p>\n<p> Setting up Care Smart on an Apple Watch with a Number Share line requires an iPhone with iOS 9 or later. Setting up Care Smart on Android-powered watches with a Number Share line requires a smartphone with Android 5.0 or later. If the watch is on a standalone line, both iOS 9 or later and Android 5.0 or later can be used for setup. Once Care Smart is set up, the watch user’s Trust Circle contacts may use the Care Smart app on either iOS or Android-powered smartphones. </p>\n<p> You can cancel Smartwatch Data &amp; Safety at any time through My Verizon Online or the My Verizon App. Upon cancellation, you will lose your discount. Get Help - Professional Monitoring will be canceled. Your smartwatch data plan will continue for $10/mo until separately canceled. Offer may end without notice. </p>\n<p> Use of Smartwatch Data Plan is subject to <a href="/support/important-plan-information/" tabindex="0" data-track="important plan information" style="color:inherit">Important Plan Information</a>. Use of Care Smart and Get Help - Professional Monitoring is subject to <a href="/support/care-smart-terms/" tabindex="0" data-track="terms and conditions" style="color:inherit">Care Smart Terms &amp; Conditions</a>. </p>'
